// http://localhost:5235
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PersonList = () => {
  const [persons, setPersons] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:5235/api/student');
      setPersons(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div className="container mt-3">
      <h2>Person List</h2>
      <table className="table">
        <thead>
          <tr>
            <th>Student ID</th>
            <th>Student Code</th>
            <th>Full Name</th>
            <th>Age</th>
            <th>Address</th>
            <th>Email</th>
          </tr>
        </thead>
        <tbody>
          {persons.map(person => (
            <tr key={person.studentID}>
              <td>{person.studentID}</td>
              <td>{person.studentCode}</td>
              <td>{person.fullName}</td>
              <td>{person.age}</td>
              <td>{person.address}</td>
              <td>{person.email}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PersonList;
